import React from 'react';

function Main() {
  return (
    <main>
      <p>Welcome to my React app!</p>
      <iframe title='timelapse' width="100%" height="360" src="//www.teleport.io/player?playmode=livetimelapse" frameborder="0" allowfullscreen></iframe>
    </main>
  );
}

export default Main;
